import React, { useState } from "react";
import "./style.css";

const AddProfessional = () => {
  const [professional, setProfessional] = useState([
    {
      name: "Jai",
      email: "jaichopra@gmail.com",
      number: "99999999",
      password: "jai@123",
    },
  ]);

  const [formData, setFormData] = useState({
    name: "",
    email: "",
    number: "",
    password: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (
      !formData.name ||
      !formData.email ||
      !formData.number ||
      !formData.password
    ) {
      alert("Please fill all fields!");
      return;
    }

    setProfessional([...professional, formData]);
    setFormData({ name: "", email: "", number: "", password: "" });
    alert("Professional added successfully!");
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Add a Professional</h2>

      {/* --- Form --- */}
      <form
        onSubmit={handleSubmit}
        className="p-4 border rounded shadow-sm bg-light"
        style={{ maxWidth: "600px", margin: "0 auto" }}
      >
        <div className="mb-3">
          <label className="form-label">Full Name</label>
          <input
            type="text"
            name="name"
            className="form-control"
            placeholder="Enter full name"
            value={formData.name}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Email Address</label>
          <input
            type="email"
            name="email"
            className="form-control"
            placeholder="Enter email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Phone Number</label>
          <input
            type="text"
            name="number"
            className="form-control"
            placeholder="Enter phone number"
            value={formData.number}
            onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label className="form-label">Password</label>
          <input
            type="password"
            name="password"
            className="form-control"
            placeholder="Enter password"
            value={formData.password}
            onChange={handleChange}
          />
        </div>

        <button type="submit" className="btn btn-primary w-100">
          Add Professional
        </button>
      </form>

      {/* --- List of Professionals --- */}
      <div className="mt-5">
        <h4 className="text-center">Registered Professionals</h4>
        <table className="table table-striped mt-3">
          <thead>
            <tr>
              <th>#</th>
              <th>Full Name</th>
              <th>Email</th>
              <th>Phone Number</th>
            </tr>
          </thead>
          <tbody>
            {professional.map((pro, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{pro.name}</td>
                <td>{pro.email}</td>
                <td>{pro.number}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AddProfessional;
